  false,\n\t\"url\": null,\n\t\"notes\": \"Hourly measurements made by selected ship
  sensors on the NOAA ship Ronald H. Brown during the \"Deep Sea Medicines 2003: Exploration
  of the Gulf of Mexico\" expedition sponsored by the National Oceanic and Atmospheric
  Administration (NOAA) Office of Ocean Exploration, September 8 through September
  19, 2003. Measurements include ship's position and heading, air temperature, relative
  humidity, barometric pressure, wind speed and direction, depth, chlorophyll-a (fluorometer),
  sea surface temperature, and salinity. This data set was compiled from NOAA's Shipboard
